import React from 'react';
import {Switch, Route } from 'react-router-dom';

import Home from './Home';
import Login from './Login';

export default Main = () => {
    return (
	  <Switch>
		<Route exact path='/' component={Home}></Route>
		<Route exact path='/login' component={Login}></Route>
	  </Switch>
	);
}
